hubaneswar', 'Berhampur', 'Ganjam', 'Gajapati'
];

function AutocompleteCity({ label, value, onChange }) {
  return (
    <Autocomplete
      options={cityList}
      value={value}
      onChange={(_, newValue) => onChange(newValue)}
      renderInput={(params) => (
        <TextField
          {...params}
          label={label}
          variant="outlined"
          InputProps={{
            ...params.InputProps,
            startAdornment: (
              <InputAdornment position="start">
                <LocationOnIcon color="primary" />
              </InputAdornment>
            ),
          }}
        />
      )}
      freeSolo
      fullWidth
    />
  );
}

export default AutocompleteCity;
